const BRICK_INFO = {
  TRIANGLE: {
    type: 'TRIANGLE',
    point: 1,
    imageSrc: "data:image/png;base64,"
  },
  RECTANGLE: {
    type: 'RECTANGLE',
    point: 100,
    imageSrc: "data:image/png;base64,"
  },
  PENTAGON:{
    type: 'PENTAGON',
    point: 1000,
    imageSrc: "data:image/png;base64,"
  },
  DIMOND:{
    type: 'DIMOND',
    point: 5000,
    imageSrc: "data:image/png;base64,"
  },
  STAR:{
    type: 'STAR',
    point: 10000,
    imageSrc: "data:image/png;base64,"
  }
}

const IMGSOURCE_MAPPING ={

}

const hashFunction = function(src) {
  var hash = 0, i, chr;
  if (src.length === 0) return hash;
  
  for (i = 0; i < src.length; i++) {
    chr = src.charCodeAt(i);
    hash = ((hash << 5) - hash) + chr;
    hash |= 0; // Convert to 32bit integer
  }
  return hash;
};

for(let key in BRICK_INFO){
  let info = BRICK_INFO[key]
  let image = new Image()
  image.src = info.imageSrc
  info.image = image

  IMGSOURCE_MAPPING[hashFunction(info.imageSrc)] = info.type
}